import { StyleSheet, View, Text, Image } from 'react-native'
import "./assets/css/main.css";
import Axios from 'axios'


const SignUpComplete = () => {

  return (
	<View>
		<View>
		<View style={styles.middle}>
				<Text style={styles.title}>Вітаємо!</Text>
			</View>
			<Image source={require("../assets/success.png")} style={{
					width: '68%', marginLeft: '16%', height: '68%'
				}} />
			<View style={styles.middle}>
				<Text style={styles.title2}>Реєстрація завершена</Text>
			</View>

			<form action="" onSubmit={handleSubmit}>
				<View style={styles.spaceBtn}>
					<View style={styles.btn}>
						<View style={styles.middleBtn}>
							<View style={styles.middleBtn} onClick={handleSubmit}>
								<Text style={styles.textBtn}>Старт</Text>
							</View>
						</View>
					</View>
				</View>
			</form>
		</View>
	</View>
  );
};

export default SignUpComplete
